import React from 'react'
import logo from "../../images/shakedown.jpg";
import "../../StyleSheet/MobileNavBar.css";

const MobileNavBar = () => {
    return (
        <div className="MobileNav__container">

            <img src={logo} alt="Company Logo" />
            
        </div>
    )
}

export default MobileNavBar
